export interface AlgorithmManager {
    doExecute: (options: {
        input: unknown;
        width: number;
        height: number;
        timeStamp: number;
        success: (algRes: unknown) => void;
        fail: (algRes: unknown) => void;
    }) => void;
}
export interface Rect {
    x: number;
    y: number;
    width: number;
    height: number;
}
export interface Point {
    x: number;
    y: number;
}
export interface PointArray {
    points: Float32Array;
    get: (index: number) => Point;
}
